import React from "react";
import Slider from "react-slick";
import "./Home.css";

const Home = () => {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
    autoplay: true,
    autoplaySpeed: 3000,
  };

  const images = [
    { src: "path/to/image1.jpg", alt: "Tent Image 1" },
    { src: "path/to/image2.jpg", alt: "Tent Image 2" },
    { src: "path/to/image3.jpg", alt: "Tent Image 3" },
    // Add more images as needed
  ];

  return (
    <div className="home">
      <Slider {...settings} className="slider">
        {images.map((image, index) => (
          <div key={index} className="slider-item">
            <img src={image.src} alt={image.alt} />
          </div>
        ))}
      </Slider>
      <section className="hero">
        <h1>Welcome to Our Tent House</h1>
        <p>
          We provide a variety of tents for all your needs. Contact us to know
          more.
        </p>
      </section>
      <section className="services">
        <h2>Our Services</h2>
        <ul>
          <li>Event Tent Rentals</li>
          <li>Camping Tents</li>
          <li>Luxury Tent Setups</li>
        </ul>
      </section>
      <section className="about">
        <h2>About Us</h2>
        <p>
          We are dedicated to providing high-quality tents for all occasions.
          Our team ensures that every setup is perfect for your event or
          adventure.
        </p>
      </section>
    </div>
  );
};

export default Home;
